import React from 'react';
import './index.css';


function Blog({items}){

    return(
        <div className='blocks'>
            console.log(items[0]);
            {items.map( (item, index) => (
                <div className={'item' + index%2 === 0 ? '1' : '2'} key={`${item}_${index}`}>{item}</div>
            ))
            }
        </div> 
        );
}


export default Blog;
